import React from 'react';

export default function Projects(props){
    return (
        <div>
            <h1>The best project managment app</h1>
            <p>You can manage all your project here!</p>
            <div className="shadow p-3 bg-white rounded">
                <img src="https://sleekbundle.com/wp-content/uploads/2020/01/18-Site-under-construction-1250x835.png" alt="project_managment"/>
            </div>
            <br/><br/>

        </div>
    )
}
